import axios from 'axios';
export const signin=(data)=>
{
    axios.post(`http://localhost:5001/api/users/sigin`,{data})
      .then(res => {
          return res;
      })
}
export const login=(data)=>
{
    axios.post(`http://localhost:5001/api/users/logiin`,{data})
      .then(res => {
          return res;
      })
}
